// Init PubNub

var p = PUBNUB.init({
  subscribe_key: 'sub-c-fe732e4c-3942-11e6-a169-02ee2ddab7fe',
  publish_key:   'pub-c-bdcb8311-b1ad-476a-8ff5-6fc084b51822'
});

// Sending data

function disco() {
  p.publish({
    channel : 'disco', // This is the channel name you are subscribing in remote-led.py
    message : {led: 1}
  });
}

// Click event
document.querySelector('button').addEventListener('click', disco);
